/* This example requires Tailwind CSS v2.0+ */
import {Fragment, useEffect, useState} from 'react'
import { Disclosure, Menu, Transition } from '@headlessui/react'
import axios from "axios";
import {useParams} from "react-router-dom";


const user = {
    name: 'Tom Cook',
    email: 'tom@example.com',
    imageUrl:
        'https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80',
}
const navigation = [
    { name: 'Dashboard', href: '#', current: true },
    { name: 'Team', href: '#', current: false },
    { name: 'Projects', href: '#', current: false },
    { name: 'Calendar', href: '#', current: false },
]
const userNavigation = [
    { name: 'Your Profile', href: '#' },
    { name: 'Settings', href: '#' },
    { name: 'Sign out', href: '#' },
]

function classNames(...classes) {
    return classes.filter(Boolean).join(' ')
}

export const Event = () => {

    const [event, setEvent] = useState({})

    const {eventId} = useParams()

    console.log(eventId)

    const getEvent = () =>{

        axios.get(`/api/public/get-event/${eventId}`)
            .then(res=>{
                setEvent(res.data)
            })
            .catch(error=>{
                console.log(error)
            })

    }

    useEffect(()=>{
        getEvent()
    },[])

    console.log(event)

    return (


            <div className="min-h-full">
                <div className="bg-white border-b border-gray-200 max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex justify-between h-16">
                        <div className="flex">
                            <div className="flex-shrink-0 flex items-center">
                                <img
                                    className=" h-8 w-auto"
                                    src="https://tailwindui.com/img/logos/workflow-logo-indigo-600-mark-gray-800-text.svg"
                                    alt="Workflow"
                                />
                            </div>

                        </div>
                    </div>
                </div>

                <div className="py-10">
                    <header>
                        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                            <h1 className="text-center text-3xl font-bold leading-tight text-gray-900">{event.name}</h1>
                        </div>
                    </header>
                    <main>
                        <div className="max-w-7xl mx-auto sm:px-6 lg:px-8">
                            {/* Replace with your content */}
                            <div className=" px-4 py-8 sm:px-0">
                                <h1>aaa</h1>
                            </div>
                            {/* /End replace */}
                        </div>
                    </main>
                </div>
            </div>

    )
}
